import React, { useState, useEffect } from 'react';
import {
  Container,
  Typography,
  Box,
  Card,
  CardContent,
  Grid,
  Avatar,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Alert,
  CircularProgress,
  Chip,
} from '@mui/material';
import {
  Edit,
  Person,
  FitnessCenter,
  Height,
  MonitorWeight,
  CalendarToday,
} from '@mui/icons-material';
import { useAuth } from '../contexts/AuthContext';
import { userProfileApi } from '../services/api';

const Profile: React.FC = () => {
  const { user } = useAuth();
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [userProfile, setUserProfile] = useState<any>(null);
  const [editOpen, setEditOpen] = useState(false);
  const [editData, setEditData] = useState({
    height: '',
    currentWeight: '',
    targetWeight: '',
    activityLevel: '',
    fitnessGoal: '',
  });

  useEffect(() => {
    fetchProfile();
  }, []);

  const fetchProfile = async () => {
    setLoading(true);
    try {
      const profile = await userProfileApi.getProfile();
      setUserProfile(profile);
      setEditData({
        height: profile.height?.toString() || '',
        currentWeight: profile.currentWeight?.toString() || '',
        targetWeight: profile.targetWeight?.toString() || '',
        activityLevel: profile.activityLevel || '',
        fitnessGoal: profile.fitnessGoal || '',
      });
    } catch (err) {
      console.error('Error fetching profile:', err);
      setError('Failed to load profile data');
    } finally {
      setLoading(false);
    }
  };

  const handleUpdateProfile = async () => {
    try {
      await userProfileApi.updateProfile({
        height: parseFloat(editData.height),
        currentWeight: parseFloat(editData.currentWeight),
        targetWeight: parseFloat(editData.targetWeight),
        activityLevel: editData.activityLevel,
        fitnessGoal: editData.fitnessGoal,
      });
      setEditOpen(false);
      fetchProfile();
      setError('');
    } catch (err) {
      console.error('Error updating profile:', err);
      setError('Failed to update profile');
    }
  };

  const calculateBMI = (weight: number, height: number) => {
    if (!weight || !height) return 0;
    return weight / ((height / 100) ** 2);
  };

  const getBMICategory = (bmi: number) => {
    if (bmi < 18.5) return { category: 'Underweight', color: 'info' };
    if (bmi < 25) return { category: 'Normal', color: 'success' };
    if (bmi < 30) return { category: 'Overweight', color: 'warning' };
    return { category: 'Obese', color: 'error' };
  };

  if (loading) {
    return (
      <Container maxWidth="lg">
        <Box display="flex" justifyContent="center" alignItems="center" minHeight="400px">
          <CircularProgress />
        </Box>
      </Container>
    );
  }

  const bmi = calculateBMI(userProfile?.currentWeight, userProfile?.height);
  const bmiInfo = getBMICategory(bmi);

  return (
    <Container maxWidth="lg">
      <Box sx={{ mb: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom>
          My Profile
        </Typography>
        <Typography variant="body1" color="text.secondary">
          Manage your personal information and fitness goals
        </Typography>
      </Box>

      {error && (
        <Alert severity="error" sx={{ mb: 3 }}>
          {error}
        </Alert>
      )}

      <Grid container spacing={3}>
        {/* Personal Information */}
        <Grid item xs={12} md={4}>
          <Card>
            <CardContent sx={{ textAlign: 'center' }}>
              <Avatar sx={{ width: 80, height: 80, mx: 'auto', mb: 2, bgcolor: 'primary.main' }}>
                <Person sx={{ fontSize: 40 }} />
              </Avatar>
              <Typography variant="h5" gutterBottom>
                {user?.firstName} {user?.lastName}
              </Typography>
              <Typography variant="body2" color="text.secondary" gutterBottom>
                {user?.email}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Member since {new Date(user?.createdAt || '').toLocaleDateString()}
              </Typography>
              <Button
                variant="contained"
                startIcon={<Edit />}
                onClick={() => setEditOpen(true)}
                sx={{ mt: 2 }}
              >
                Edit Profile
              </Button>
            </CardContent>
          </Card>
        </Grid>

        {/* Physical Stats */}
        <Grid item xs={12} md={8}>
          <Grid container spacing={2}>
            <Grid item xs={12} sm={6}>
              <Card>
                <CardContent>
                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                    <Height sx={{ color: 'primary.main', mr: 1 }} />
                    <Typography variant="h6">Height</Typography>
                  </Box>
                  <Typography variant="h4" color="primary.main">
                    {userProfile?.height || 'Not set'} {userProfile?.height ? 'cm' : ''}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>

            <Grid item xs={12} sm={6}>
              <Card>
                <CardContent>
                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                    <MonitorWeight sx={{ color: 'secondary.main', mr: 1 }} />
                    <Typography variant="h6">Current Weight</Typography>
                  </Box>
                  <Typography variant="h4" color="secondary.main">
                    {userProfile?.currentWeight || 'Not set'} {userProfile?.currentWeight ? 'kg' : ''}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>

            <Grid item xs={12} sm={6}>
              <Card>
                <CardContent>
                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                    <FitnessCenter sx={{ color: 'success.main', mr: 1 }} />
                    <Typography variant="h6">Target Weight</Typography>
                  </Box>
                  <Typography variant="h4" color="success.main">
                    {userProfile?.targetWeight || 'Not set'} {userProfile?.targetWeight ? 'kg' : ''}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>

            <Grid item xs={12} sm={6}>
              <Card>
                <CardContent>
                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                    <CalendarToday sx={{ color: 'warning.main', mr: 1 }} />
                    <Typography variant="h6">BMI</Typography>
                  </Box>
                  <Typography variant="h4" color="warning.main">
                    {bmi ? bmi.toFixed(1) : 'Not calculated'}
                  </Typography>
                  {bmi > 0 && (
                    <Chip
                      label={bmiInfo.category}
                      color={bmiInfo.color as any}
                      size="small"
                      sx={{ mt: 1 }}
                    />
                  )}
                </CardContent>
              </Card>
            </Grid>
          </Grid>
        </Grid>

        {/* Fitness Goals */}
        <Grid item xs={12}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Fitness Information
              </Typography>
              <Grid container spacing={3}>
                <Grid item xs={12} sm={6}>
                  <Typography variant="body2" color="text.secondary">
                    Activity Level
                  </Typography>
                  <Typography variant="body1" fontWeight="bold">
                    {userProfile?.activityLevel || 'Not set'}
                  </Typography>
                </Grid>
                <Grid item xs={12} sm={6}>
                  <Typography variant="body2" color="text.secondary">
                    Fitness Goal
                  </Typography>
                  <Typography variant="body1" fontWeight="bold">
                    {userProfile?.fitnessGoal || 'Not set'}
                  </Typography>
                </Grid>
              </Grid>
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* Edit Profile Dialog */}
      <Dialog open={editOpen} onClose={() => setEditOpen(false)} maxWidth="sm" fullWidth>
        <DialogTitle>Edit Profile</DialogTitle>
        <DialogContent>
          <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2, pt: 1 }}>
            <TextField
              label="Height (cm)"
              type="number"
              value={editData.height}
              onChange={(e) => setEditData({ ...editData, height: e.target.value })}
              fullWidth
            />
            <TextField
              label="Current Weight (kg)"
              type="number"
              value={editData.currentWeight}
              onChange={(e) => setEditData({ ...editData, currentWeight: e.target.value })}
              fullWidth
            />
            <TextField
              label="Target Weight (kg)"
              type="number"
              value={editData.targetWeight}
              onChange={(e) => setEditData({ ...editData, targetWeight: e.target.value })}
              fullWidth
            />
            <FormControl fullWidth>
              <InputLabel>Activity Level</InputLabel>
              <Select
                value={editData.activityLevel}
                onChange={(e) => setEditData({ ...editData, activityLevel: e.target.value })}
                label="Activity Level"
              >
                <MenuItem value="Sedentary">Sedentary</MenuItem>
                <MenuItem value="Lightly Active">Lightly Active</MenuItem>
                <MenuItem value="Moderately Active">Moderately Active</MenuItem>
                <MenuItem value="Very Active">Very Active</MenuItem>
                <MenuItem value="Extremely Active">Extremely Active</MenuItem>
              </Select>
            </FormControl>
            <FormControl fullWidth>
              <InputLabel>Fitness Goal</InputLabel>
              <Select
                value={editData.fitnessGoal}
                onChange={(e) => setEditData({ ...editData, fitnessGoal: e.target.value })}
                label="Fitness Goal"
              >
                <MenuItem value="Weight Loss">Weight Loss</MenuItem>
                <MenuItem value="Weight Gain">Weight Gain</MenuItem>
                <MenuItem value="Maintain Weight">Maintain Weight</MenuItem>
                <MenuItem value="Build Muscle">Build Muscle</MenuItem>
                <MenuItem value="Improve Fitness">Improve Fitness</MenuItem>
              </Select>
            </FormControl>
          </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setEditOpen(false)}>Cancel</Button>
          <Button onClick={handleUpdateProfile} variant="contained">
            Update Profile
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default Profile;
